// SPDX-License-Identifier: MIT

pragma solidity >=0.8.13;

contract TransferContract {
    struct transferManagement {
        address payable accountAddress;
        uint percent;
    }

    transferManagement[] listAccountTransfer;

    function addTransfer(
        address payable _accountAddress,
        uint _percent
    ) public {
        require(_percent <= 100, "A porcentagem nao pode ser maior que 100");

        uint newTotalPercent = _percent;
        for (uint i = 0; i < listAccountTransfer.length; i++) {
            newTotalPercent += listAccountTransfer[i].percent;
            require(
                _accountAddress != listAccountTransfer[i].accountAddress,
                "A conta escolhida ja possui valores de transferencia registrados. Para adicionar um novo valor remova o valor anterior "
            );
        }

        require(newTotalPercent <= 100, "O total de porcentagem eh maior 100");

        transferManagement memory newTransfer = transferManagement(
            _accountAddress,
            _percent
        );
        listAccountTransfer.push(newTransfer);
    }

    function viewAccountsTransfer()
        public
        view
        returns (transferManagement[] memory)
    {
        return listAccountTransfer;
    }

    function removeTransferByAddress(address payable _accountAddress) public {
        for (uint i = 0; i < listAccountTransfer.length; i++) {
            if (listAccountTransfer[i].accountAddress == _accountAddress) {
                listAccountTransfer[i] = listAccountTransfer[
                    listAccountTransfer.length - 1
                ];
                listAccountTransfer.pop();
                break;
            }
        }
    }
}
